import React from 'react';
import PropTypes from 'prop-types';
import Slider from '@mui/material/Slider';
import InputLabel from '@mui/material/InputLabel';
import FormControl from '@mui/material/FormControl';
const Jouster = () => {

  const [strength, setStrength] = React.useState(5);
  const [luck, setLuck] = React.useState(5);
  const [dexterity, setDexterity] = React.useState(5);
  const [name, setName] = React.useState('');

  return (
    <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-standard-label">Strength</InputLabel>
        <Slider
          aria-label="Strength"
          defaultValue={strength}
          valueLabelDisplay="auto"
          step={1}
          marks
          min={1}
          max={10}
        />
        <InputLabel id="demo-simple-select-standard-label">Dexterity</InputLabel>
        <Slider
          aria-label="Dexterity"
          defaultValue={dexterity}
          valueLabelDisplay="auto"
          step={1}
          marks
          min={1}
          max={10}
        />
        <div>
          <InputLabel id="demo-simple-select-standard-label">Luck</InputLabel>
          <Slider
            aria-label="Luck"
            defaultValue={luck}
            valueLabelDisplay="auto"
            step={1}
            marks
            min={1}
            max={10}
          />
        </div>
    </FormControl>
  )
};

Jouster.propTypes = {};

Jouster.defaultProps = {};

export default Jouster;
